css:
@-moz-document domain("grupia.com")
{
	.header-container, .header
	{
	  background-color: rgb(0,0,0);
	}
	.button.highlight, .side-menu-button.selected, .context-menu.show a:hover
	{
	  background-color: rgb(52, 52, 52) !important;
	}
	.side-menu-button.selected
	{
		color: white !important;
	}

	.comunity-title, .user-profile-dashboard h1
	{
		color: rgb(0,0,0);
	}

	.soft-card
	{
		background-color: rgb(220, 220, 220);
		color: rgb(0,0,0);
	}

	.soft-card a
	{
		color: rgb(52, 52, 52);
	}

	.card-text a
	{
		color: rgb(0,0,0);
	}
}
